import React from 'react'

// const Projects = () => {
//   return (
//     <div>Projects</div>
//   )
// }

// export default Projects

import Card from 'react-bootstrap/Card';
import ListGroup from 'react-bootstrap/ListGroup';

function Projects() {
  return (
    <Card style={{ width: '18rem' }}>
      <Projects variant="flush">
        <Projects.Item>Cras justo odio</Projects.Item>
        <Projects.Item>Dapibus ac facilisis in</Projects.Item>
        <Projects.Item>Vestibulum at eros</Projects.Item>
      </Projects>
    </Card>
  );
}

export default ListGroupExample;
